UPDATE `page_text` SET `text` = 'The dwarves of Ironforge Mountain lived in peace for many long centuries. However, their society grew too large within the confines of their mountain cities. Though the mighty High King, Modimus Anvilmar, ruled over all dwarves with justice and wisdom, three powerful factions had arisen amongst the dwarven society. ', `next_page` = '1915' WHERE `entry` = '1914';
UPDATE `page_text` SET `text` = 'The Bronzebeard clan, ruled by Thane Madoran Bronzebeard, held close ties to the High King and stood as the traditional defenders of Ironforge Mountain. The Wildhammer clan, ruled by Thane Khardros Wildhammer, inhabited the foothills and crags around the base of the mountain and sought to gain more control within the city. ', `next_page` = '1916' WHERE `entry` = '1915';
UPDATE `page_text` SET `text` = 'The third faction, the Dark Iron clan, was ruled by the sorcerer-thane Thaurissan. The Dark Irons hid within the deepest shadows under the mountain and plotted against both their Bronzebeard and the Wildhammer cousins.', `next_page` = '1917' WHERE `entry` = '1916';
UPDATE `page_text` SET `text` = 'For a time the three factions kept a tenuous peace, but tensions erupted when High King Anvilmar passed away from old age. The three ruling clans went to war for control of Ironforge itself. The dwarf civil war raged under the earth for many years. Eventually the Bronzebeards, who had the largest standing army, banished the Dark Irons and Wildhammers from under the mountain. ', `next_page` = '1918' WHERE `entry` = '1917';
UPDATE `page_text` SET `text` = 'Khardros and his Wildhammer warriors traveled north through the barrier gates of Dun Algaz, and they founded their own kingdom within the distant peak of Grim Batol. There, the Wildhammers thrived and rebuilt their stores of treasure. Thaurissan and his Dark Irons did not fare as well. Humiliated and enraged by their defeat, they vowed revenge against Ironforge. Leading his people far to the south, Thaurissan founded a city (which he named after himself) within the beautiful Redridge Mountains.', `next_page` = '1919' WHERE `entry` = '1918';
UPDATE `page_text` SET `text` = 'Prosperity and the passing of years did little to ease the Dark Iron\'s rancor toward their cousins. Thaurissan and his sorceress wife, Modgud, launched a two-pronged assault against both Ironforge and Grim Batol. The Dark Irons were intent on claiming all of Khaz Modan for their own. ', `next_page` = '1920' WHERE `entry` = '1919';
UPDATE `page_text` SET `text` = 'The Dark Iron armies smashed against their cousins\' strongholds and very nearly took both kingdoms. However, Madoran Bronzebeard ultimately led his clan to a decisive victory over Thaurissan\'s sorcerous army. Thaurissan and his servants fled back to the safety of their city, unaware of the events transpiring at Grim Batol, where Modgud\'s army would fare no better against Khardros and his Wildhammer warriors. ', `next_page` = '1921' WHERE `entry` = '1920';
UPDATE `page_text` SET `text` = 'As she confronted the enemy warriors, Modgud used her powers to strike fear into their hearts. Shadows moved at her command, and dark things crawled up from the depths of the earth to stalk the Wildhammers in their own halls. Eventually Modgud broke through the gates and laid siege to the fortress itself. The Wildhammers fought desperately, Khardros himself wading through the roiling masses to slay the sorceress queen. ', `next_page` = '1922' WHERE `entry` = '1921';
UPDATE `page_text` SET `text` = 'With their queen lost, the Dark Irons fled before the fury of the Wildhammers. They raced south toward their king\'s stronghold, only to meet the armies of Ironforge, which had come to aid Grim Batol. Crushed between two armies, the remaining Dark Iron forces were utterly destroyed. ', `next_page` = '1923' WHERE `entry` = '1922';
UPDATE `page_text` SET `text` = 'The combined armies of Ironforge and Grim Batol then turned south, intent on destroying Thaurissan and his Dark Irons once and for all. They had not gone far when Thaurissan\'s fury resulted in a spell of cataclysmic proportions. Seeking to summon a supernatural minion that would ensure his victory, Thaurissan called upon the ancient powers sleeping beneath the world. To his shock, and ultimately his doom, the creature that emerged was more terrible than any nightmare he could have imagined.', `next_page` = '1924' WHERE `entry` = '1923';
UPDATE `page_text` SET `text` = 'Ragnaros the Firelord, immortal lord of all fire elementals, had been banished by the Titans when the world was young. Now, freed by Thaurissan\'s call, Ragnaros erupted into being once again. Ragnaros\' apocalyptic rebirth into Azeroth shattered the Redridge Mountains and created a raging volcano at the center of the devastation. ', `next_page` = '1925' WHERE `entry` = '1924';
UPDATE `page_text` SET `text` = 'The volcano, known as Blackrock Mountain, was bordered by the Searing Gorge to the north and the Burning Steppes to the south. Though Thaurissan was killed by the forces he had unleashed, his surviving brethren were ultimately enslaved by Ragnaros and his elementals. They remain within the depths of Blackrock to this day. ', `next_page` = '1926' WHERE `entry` = '1925';
UPDATE `page_text` SET `text` = 'Witnessing the horrific devastation and the fires spreading across the southern mountains, King Madoran and King Khardros halted their armies and hastily turned back towards their kingdoms, unwilling to face the awesome wrath of Ragnaros. ', `next_page` = '1927' WHERE `entry` = '1926';
UPDATE `page_text` SET `text` = 'The Bronzebeards returned to Ironforge and rebuilt their glorious city. The Wildhammers also returned home to Grim Batol. However, the death of the Modgud had left an evil stain on the mountain fortress, and the Wildhammers found it uninhabitable.', `next_page` = '1928' WHERE `entry` = '1927';
UPDATE `page_text` SET `text` = ' They were bitter in their hearts over the loss of their beloved home. King Bronzebeard offered the Wildhammers a place to live within the borders of Ironforge, but the Wildhammers steadfastly refused. Khardros took his people north towards the lands of Lordaeron. Settling within the lush forests of the Hinterlands, the Wildhammers crafted the city of Aerie Peak, where the Wildhammers grew closer to nature and even bonded with the mighty gryphons of the area.', `next_page` = '1929' WHERE `entry` = '1928';
UPDATE `page_text` SET `text` = 'Seeking to retain relations and trade with their cousins, the dwarves of Ironforge constructed two massive arches, the Thandol Span, to bridge the gap between Khaz Modan and Lordaeron. Bolstered by mutual trade, the two kingdoms prospered. After the deaths of Madoran and Khardros, their sons jointly commissioned two great statues in honor of their fathers. ', `next_page` = '1930' WHERE `entry` = '1929';
UPDATE `page_text` SET `text` = 'The two statues would stand guard over the pass into the southlands, which had become volcanic in the wake of Ragnaros\' scorching presence. They served as both a warning to all who would attack the dwarven kingdoms, and as a reminder of what price the Dark Irons paid for their crimes. ', `next_page` = '1931' WHERE `entry` = '1930';
UPDATE `page_text` SET `text` = 'The two kingdoms retained close ties for some years, but the Wildhammers were much changed by the horrors they witnessed at Grim Batol. They took to living above ground on the slopes of Aerie Peak, instead of carving a vast kingdom within the mountain. The ideological differences between the two remaining dwarven clans eventually led to their parting of ways. ', `next_page` = '0' WHERE `entry` = '1931';
UPDATE `page_text` SET `text` = 'Missing: Corporal Keeshan$B$B$B$BLast seen during the bloody battle at Stonewatch Keep, Corporal Keeshan was reported to have been dragged away by Blackrock Orcs.$B$B$B$BIt is believed that Corporal Keeshan is being held as a prisoner of war at the Blackrock encampment north of Lakeshire, just west of the pass leading to the Burning Steppes.$B$B$B$BBy mandate of Magistrate Solomon, anyone who aids in the recovery of Corporal Keeshan shall be rewarded by Marshal Marris.', `next_page` = '0' WHERE `entry` = '245';
UPDATE `page_text` SET `text` = 'As Kil\'jaeden prepared the Horde for its invasion of Azeroth, Medivh continued to fight for his soul against Sargeras. King Llane, the noble monarch of Stormwind, grew wary of the darkness which seemed to taint the spirit of his former friend.', `next_page` = '1960' WHERE `entry` = '1959';
UPDATE `page_text` SET `text` = 'King Llane shared his concerns with Anduin Lothar, the last descendent of the Arathi bloodline, whom he named his lieutenant-at-arms. Even so, neither man could have imagined that Medivh\'s slow descent into madness would bring about the horrors that were to come.', `next_page` = '1961' WHERE `entry` = '1960';
UPDATE `page_text` SET `text` = 'As a final incentive, Sargeras promised to bestow great power upon Gul\'dan if he agreed to lead the Horde to Azeroth. Through Medivh, Sargeras told the warlock that he could become a living god if he found the undersea tomb where the Guardian Aegwynn had placed Sargeras\' crippled body nearly a thousand years before.', `next_page` = '1962' WHERE `entry` = '1961';
UPDATE `page_text` SET `text` = ' Gul\'dan agreed and decided that once the denizens of Azeroth were beaten, he would find the legendary tomb and claim his reward. Assured that the Horde would serve his purposes, Sargeras ordered the invasion to begin.', `next_page` = '1963' WHERE `entry` = '1962';
UPDATE `page_text` SET `text` = 'Through a joint effort, Medivh and the warlocks of the Shadow Council opened the dimensional gateway known as the Dark Portal. This portal bridged the distance between Azeroth and Draenor, and it was large enough that armies might pass through it. Gul\'dan dispatched orc scouts through the portal to survey the lands which they would conquer. The returning scouts assured the Shadow Council that the world of Azeroth was ripe for the taking.', `next_page` = '1964' WHERE `entry` = '1963';
UPDATE `page_text` SET `text` = 'Still convinced that Gul\'dan\'s corruption would destroy his people, Durotan spoke out against the warlocks once more. The brave warrior claimed that warlocks were destroying the purity of the orcish spirit and that this reckless invasion would be their doom. Gul\'dan, unable to risk killing such a popular hero, was forced to exile Durotan and his Frostwolf Clan into the far reaches of this new world.', `next_page` = '1965' WHERE `entry` = '1964';
UPDATE `page_text` SET `text` = 'After the exiled Frostwolves charged through the portal, only a few orc clans followed. These orcs quickly set up a base of operations within the Black Morass, a dark and swampy area far to the east of the kingdom of Stormwind. As the orcs began to branch out and explore the new lands, they came into immediate conflict with the human defenders of Stormwind. $B$B', `next_page` = '1966' WHERE `entry` = '1965';
UPDATE `page_text` SET `text` = 'Though these skirmishes usually ended quickly, they did much to illustrate the weaknesses and strengths of both rival species. Llane and Lothar were never able to gather accurate data of the orcs\' numbers and could only guess at how great a force they would have to contend with. ', `next_page` = '1967' WHERE `entry` = '1966';
UPDATE `page_text` SET `text` = 'After a few years the majority of the orcish Horde had crossed into Azeroth, and Gul\'dan deemed that the time for the primary strike against humanity had come. The Horde launched its full might against the unsuspecting kingdom of Stormwind. ', `next_page` = '1968' WHERE `entry` = '1967';
UPDATE `page_text` SET `text` = 'As the forces of Azeroth and the Horde clashed across the kingdom, internal conflicts began to take their toll on both armies. King Llane, who believed the bestial orcs to be incapable of conquering Azeroth, contemptuously held his position at his capital of Stormwind. However, Sir Lothar became convinced that the battle should be taken directly to the enemy, and he was forced to choose between his convictions and his loyalty to the king. ', `next_page` = '1969' WHERE `entry` = '1968';
UPDATE `page_text` SET `text` = 'Choosing to follow his instincts, Lothar stormed Medivh\'s tower-fortress of Karazhan with the help of the wizard\'s young apprentice, Khadgar. Khadgar and Lothar succeeded in vanquishing the possessed Guardian, whom they confirmed to be the source of the conflict. ', `next_page` = '1970' WHERE `entry` = '1969';
UPDATE `page_text` SET `text` = 'By killing Medivh\'s body, Lothar and the young apprentice inadvertently banished the spirit of Sargeras to the abyss. As a consequence, the pure, virtuous spirit of Medivh was also allowed to live on... and wander the astral plane for many years to come.', `next_page` = '1971' WHERE `entry` = '1970';
UPDATE `page_text` SET `text` = 'Although Medivh had been defeated, the Horde continued to dominate the defenders of Stormwind. As the Horde\'s victory drew nearer, Orgrim Doomhammer, one of the greatest orc chieftains, began to see the depraved corruption that had spread throughout the clans since their time in Draenor.', `next_page` = '1972' WHERE `entry` = '1971';
UPDATE `page_text` SET `text` = 'His old comrade, Durotan, returned from exile and warned him yet again of Gul\'dan\'s treachery. In speedy retribution, Gul\'dan\'s assassins murdered Durotan and his family, leaving only his infant son alive. Unknown to Doomhammer was the fact that Durotan\'s infant son was found by the human officer, Aedelas Blackmoore, and taken as a slave. $B$B$B$BThat infant orc would one day rise to become the greatest leader his people would ever know. ', `next_page` = '1973' WHERE `entry` = '1972';
UPDATE `page_text` SET `text` = 'Incensed by Durotan\'s death, Orgrim set out to free the Horde from demonic corruption and ultimately assumed the role of warchief of the Horde by killing Gul\'dan\'s corrupt puppet, Blackhand. Under his decisive leadership the relentless Horde finally laid siege to Stormwind Keep. ', `next_page` = '1974' WHERE `entry` = '1973';
UPDATE `page_text` SET `text` = 'King Llane had severely underestimated the might of the Horde, and he watched helplessly as his kingdom fell to the green-skinned invaders. Ultimately King Llane was assassinated by one of the Shadow Council\'s finest killers: the half-orc, Garona.', `next_page` = '1975' WHERE `entry` = '1974';
UPDATE `page_text` SET `text` = 'Lothar and his warriors, returning home from Karazhan, hoped to stem the loss of life and save their once-glorious homeland. Instead, they returned too late and found their beloved kingdom in smoking ruins. The orcish Horde continued to ravage the countryside and claimed the surrounding lands for its own. Forced into hiding, Lothar and his companions swore a grim oath to reclaim their homeland at any cost.', `next_page` = '0' WHERE `entry` = '1975';

