INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1828', 'The few night elves that survived the horrific explosion rallied together on crudely made rafts and slowly made their way to the only landmass in sight. Somehow, by the grace of Elune, Malfurion, Tyrande, and Cenarius had survived the Great Sundering. The weary heroes agreed to lead their fellow survivors and establish a new home for their people. ', '1829');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1829', 'As they journeyed in silence, they surveyed the wreckage of their world and realized that their passions had wrought the destruction all around them. Though Sargeras and his Legion had been ripped from the world by the Well\'s destruction, Malfurion and his companions were left to ponder the terrible cost of victory. ', '1830');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1830', 'There were many Highborne who did survive the cataclysm unscathed. They made their way to the shores of the new land along with the other night elves. Though Malfurion mistrusted the Highborne\'s motivations, he was satisfied that they could cause no real mischief without the Well\'s energies.', '1831');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1831', 'As the weary mass of night elves landed upon the shores of the new land, they found that the holy mountain, Hyjal, had survived the catastrophe. Seeking to establish a new home for themselves, Malfurion and the night elves climbed the slopes of Hyjal and reached its windswept summit. As they descended into the wooded bowl, nestled between the mountain\'s enormous peaks, they found a small, tranquil lake. To their horror, they found that the lake\'s waters had been fouled by magic.', '1832');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1832', 'Illidan, having survived the Sundering as well, had reached Hyjal summit long before Malfurion and the night elves. In his mad bid to maintain the flows of magic in the world, Illidan had poured his vials, which contained the precious waters from the Well of Eternity, into the mountain lake. ', '1833');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1833', 'The Well\'s potent energies quickly ignited and coalesced into a new Well of Eternity. The exultant Illidan, believing that the new Well was a gift to future generations, was shocked when Malfurion hunted him down. Malfurion explained to his brother that magic was innately chaotic and that its use would inevitably lead to widespread corruption and strife. Still, Illidan refused to relinquish his magical powers.', '1834');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1834', 'Knowing full well where Illidan\'s ruthless schemes would eventually lead, Malfurion decided to deal with his power-crazed brother once and for all. With Cenarius\' help, Malfurion sealed Illidan within a vast underground barrow prison, where he would remain chained and powerless until the end of time. To ensure his brother\'s containment, Malfurion empowered the young warden, Maiev Shadowsong, to be Illidan\'s personal jailor.', '1835');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1835', 'Concerned that destroying the new Well might bring about an even greater catastrophe, the night elves resolved to leave it be. However, Malfurion declared that they would never practice the arts of magic again. Under Cenarius\' watchful eye, they began to study the ancient arts of druidism that would enable them to heal the ravaged earth and re-grow their beloved forests at the base of Mount Hyjal.', '0');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1854', 'The high elves, led by Dath\'Remar, left Kalimdor behind them and challenged the storms of the Maelstrom. Their fleets wandered the wreckage of the world for many long years, and they discovered mysteries and lost kingdoms along their sojourn. Dath\'Remar, who had taken the name Sunstrider (or "he who walks the day"), sought out places of considerable ley power upon which to build a new homeland for his people.', '1855');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1855', 'His fleet finally landed on the beaches of the kingdom men would later call Lordaeron. Forging inland, the high elves founded a settlement within the tranquil Tirisfal Glades. After a few years, many of them began to go mad. It was theorized that something evil slept beneath that particular part of the world, but the rumors were never proven to be true. The high elves packed up their encampment and moved northward towards another land rich with ley energies.', '1856');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1856', 'As the high elves crossed the rugged, mountainous lands of Lordaeron, their journey became more perilous. Since they were effectively cut off from the life-giving energies of the Well of Eternity, many of them fell ill from the frigid climate or died from starvation. The most disconcerting change, however, was the fact that they were no longer immortal or immune to the elements. ', '1857');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1857', 'They also shrank somewhat in height, and their skin lost its characteristic violet hue. Despite their hardships, they encountered many wondrous creatures that had never been seen in Kalimdor. They also found tribes of primitive humans who hunted throughout the ancient forestlands. However, the direst threat they encountered were the voracious and cunning forest trolls of Zul\'Aman.', '1858');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1858', 'These moss-skinned trolls could regenerate lost limbs and heal grievous physical injuries, but they proved to be a barbaric, evil race. The Amani empire stretched across most of northern Lordaeron, and the trolls fought hard to keep unwanted strangers from their borders. The elves developed a deep loathing for the vicious trolls and killed them on sight whenever they were encountered.', '1859');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1859', 'After many long years, the high elves finally found a land which was reminiscent of Kalimdor. Deep within the northern forests of the continent, they founded the kingdom of Quel\'Thalas and vowed to create a mighty empire which would dwarf that of their Kaldorei cousins. Unfortunately they soon learned that Quel\'Thalas was founded upon an ancient troll city that the trolls still held to be sacred. Almost immediately, the trolls began to attack the elven settlements en masse. ', '1860');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1860', 'The stubborn elves, unwilling to give up their new land, utilized the magics which they had gleaned from the Well of Eternity and kept the savage trolls at bay. Under Dath\'Remar\'s leadership, they were able to defeat the Amani warbands that outnumbered them ten to one. Some elves, wary of the Kaldorei\'s ancient warnings, felt that their use of magic might possibly draw the attention of the banished Burning Legion. ', '1861');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1861', 'Therefore, they decided to mask their lands within a protective barrier which would still allow them to work their enchantments. They constructed a series of monolithic Runestones at various points around Quel\'Thalas which marked the boundaries of the magic barrier. The Runestones not only masked the elves\' magic from extra-dimensional threats, but helped to frighten away the superstitious troll warbands as well.', '1862');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1862', 'As time wore on, Quel\'Thalas became a shining monument to the high elves\' efforts and magical prowess. Its beauteous palaces were crafted in the same architectural style as the ancient halls of Kalimdor, yet they were interwoven with the natural topography of the land. Quel\'Thalas had become the shining jewel that the elves had longed to create. ', '1863');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1863', 'The Convocation of Silvermoon was founded as the ruling power over Quel\'Thalas, though the Sunstrider Dynasty maintained a modicum of political power. Comprised of seven of the greatest high elf lords, the Convocation worked to secure the safety of the elven lands and people. Surrounded by their protective barrier, the high elves remained unmoved by the old warnings of the Kaldorei and continued to use magic flagrantly in almost all aspects of their lives. ', '1864');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1864', 'For nearly four thousand years the high elves lived peacefully within the secluded safety of their kingdom. Nevertheless, the vindictive trolls were not so easily defeated. They plotted and schemed in the depths of the forests and waited for the numbers of their warbands to grow. Finally, a mighty troll army charged out from the shadowy forests and once again laid siege to the shining spires of Quel\'Thalas. ', '0');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1942', 'Around the time of Medivh\'s birth on Azeroth, Kil\'jaeden the Deceiver sat and brooded amongst his followers within the Twisting Nether. The cunning demonlord, under orders of his master, Sargeras, was plotting the Burning Legion\'s second invasion of Azeroth. ', '1943');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1943', 'This time he would not allow any mistakes. Kil\'jaeden surmised that he needed a new force to weaken Azeroth\'s defenses before the Legion even set foot upon the world. If the mortal races, such as the night elves and dragons, were forced to contend with a new threat, they would be too weak to pose any real resistance when the Legion\'s true invasion arrived.', '1944');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1944', 'It was at this time that Kil\'jaeden discovered the lush world of Draenor floating peacefully within the Great Dark Beyond. Home to the shamanistic, clan-based orcs and the peaceful draenei, Draenor was as idyllic as it was vast. ', '1945');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1945', 'The noble orc clans roamed the open prairies and hunted for sport, while the inquisitive draenei built crude cities within the world\'s towering cliffs and peaks. Kil\'jaeden knew that Draenor\'s denizens had great potential to serve the Burning Legion if they could be cultivated properly. ', '1946');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1946', 'Of the two races, Kil\'jaeden saw that the warrior orcs were more susceptible to the Legion\'s corruption. He enthralled the elder orc shaman, Ner\'zhul, in much the same way that Sargeras brought Queen Azshara under his control in ages past. Using the cunning shaman as his conduit, the demon spread battle lust and savagery throughout the orc clans. ', '1947');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1947', 'Before long, the spiritual race was transformed into a bloodthirsty people. Kil\'jaeden then urged Ner\'zhul and his people to take the last step: to give themselves over entirely to the pursuit of death and war. Yet the old shaman, sensing that his people would be enslaved to hatred forever, somehow resisted the demon\'s command. ', '1948');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1948', 'Frustrated by Ner\'zhul\'s resistance, Kil\'jaeden searched for another orc who would deliver his people into the Legion\'s hands. The clever demonlord finally found the willing disciple he sought - Ner\'zhul\'s ambitious apprentice, Gul\'dan. Kil\'jaeden promised Gul\'dan untold power in exchange for his utter obedience. ', '1949');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1949', 'The young orc became an avid student of demonic magic and developed into the most powerful mortal warlock in history. He taught other young orcs the arcane arts and strove to eradicate the orcs\' shamanistic traditions. Gul\'dan showed a new brand of magic to his brethren, a terrible new power that reeked of doom.', '1950');
INSERT IGNORE  INTO `page_text` (`entry`, `text`, `next_page`) VALUES ('1950', 'Kil\'jaeden, seeking to tighten his hold over the orcs, helped Gul\'dan found the Shadow Council, a secretive sect that manipulated the clans and spread the use of warlock magics throughout Draenor. As more and more orcs began to wield warlock magics, the gentle fields and streams of Draenor began to blacken and fade. Over time, the vast prairies the orcs had called home for generations withered away, leaving only red barren soil. The demon energies were slowly killing the world.', '0');
